pe.file_selected=function(a){var b=$(".PhotoCell.Empty:first"),c=pe.format_file_size(a.size),c=pe.photo_html(a.name,c);b.removeClass("Empty").addClass(a.id+" Processing");b.append(c);b.find(".CancelUpload").click(pe.bind(pe.upload_cancelled,a.id));pe.update_browse_button();pe.update_upload_button()};pe.format_file_size=function(a){return 1048576<a?(a/1048576).toFixed(2)+" MB":(a/1024).toFixed(2)+" KB"};
pe.photo_html=function(a,b){return'<span class="file_name">'+a+'</span><span class="file_size">('+b+')</span><div class="progress"><div class="Completed progress_bar"></div></div><div class="CancelUpload delete_icon"></div><div class="ui-overlay" style="display: none;"><div class="loading_notice">Please wait.</div><div class="ui-widget-overlay"></div></div><div class="RollingImage loading_image" style="display: none;"></div>'};
pe.show_upload_progress=function(a,b,c){a=$("."+a.id);b=Math.round(100*(b/c));a.find(".ui-overlay:hidden").show();a.find(".RollingImage:visible").hide();a.find(".Completed").css("width",b+"%")};pe.update_browse_button=function(){0===$(".PhotoCell.Empty").length?(pe.file_input.uploadify("settings","height",0),$("#FileInputUploader").addClass("disabled")):(pe.file_input.uploadify("settings","height",pe.browse_button_height),$("#FileInputUploader").removeClass("disabled"))};
pe.update_next_step_button=function(){if(0===$(".Photo").length)return pe.next_step_button.addClass("disabled"),!1;pe.next_step_button.removeClass("disabled").removeAttr("disabled","disabled")};pe.update_upload_button=function(){pe.upload_button.unbind("click");0===$(".Processing").length?pe.upload_button.addClass("disabled"):(pe.upload_button.click(function(){pe.file_input.uploadify("upload","*")}),pe.upload_button.removeClass("disabled"))};
pe.upload_cancelled=function(a){var b=$("."+a);pe.file_input.uploadifyCancel(a);$(".UploadedPhotos").append(pe.cell_html());b.remove();pe.enumerate_cells();pe.update_browse_button();pe.update_upload_button()};pe.upload_success=function(a,b){var c=$("."+a.id);c.after(b);c.next().addClass(a.id);c.remove();pe.update_upload_button();pe.save_step_button.removeClass("disabled").removeAttr("disabled","disabled");$(".upload_error").remove();$(".cell_error").removeClass("cell_error")};
pe.upload_queue_size_exceeded=function(a,b){alert("You can upload only "+b+" images");return!1};pe.uploadify_opened=function(){$(".RollingImage").show()};
